const cryptocurrencies = require('cryptocurrencies');
export function getStocks() {
  let listInArrayForm= Object.keys(cryptocurrencies).map(x=> [x, cryptocurrencies[x]])
  listInArrayForm=listInArrayForm.map(x=>{abbr: x[0] })
  return console.log(listInArrayForm)
}
